        my ($dig,$rem) = $num->bdiv($base);
        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
                my $dec = Math::BigInt->new($decll);
                $dec->bsub($rem);
                $dec->bdiv($base);
                $decll = $dec;
                my $num2 = Math::BigInt->new($decll);
                ($dig,$rem) = $num2->bdiv($base);
                last if $j>3;
        }
        $rems{$j} = $rem;
        $divs{$j} = $dig; 
        foreach (sort {$b <=> $a} keys %rems) {
                if (defined $enc) {
                        $enc .= ''.ALPHA->[$rems{$_}];
                } else {
                        $enc = ALPHA->[$rems{$_}];
                }
        }
        return $enc;
}


sub encd {
	my $decll = shift;
        my $base = Math::BigInt->new(BASEA);
        my $j=0;
        my %rems;
        my %divs;
        my $num = Math::BigInt->new($decll);
        my ($dig,$rem) = $num->bdiv($base);
        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
                my $dec = Math::BigInt->new($decll);
                $dec->bsub($rem);
                $dec->bdiv($base);
                $decll = $dec;
                my $num2 = Math::BigInt->new($decll);
                ($dig,$rem) = $num2->bdiv($base);
		last if $j>10;
        }
	$rems{$j} = $rem;
	$divs{$j} = $dig;
	foreach (sort {$b <=> $a} keys %rems) {
		if (defined $enc) {
                        $enc .= ''.ALPHANUMERIC->[$rems{$_}];
		} else {
			$enc = ALPHANUMERIC->[$rems{$_}];
		}
	}
	return $enc;
}



