sub lltodec {
        my ($lat,$lon,$geoname,$el) = @_;
	$lat = sprintf( "%.5f", $lat );
	$lon = sprintf( "%.5f", $lon );
	$el = 0 unless defined $el;
	$el = int($el);
	my $flagel;
	if ($el<0) {
		$flagel = '-';
	} else {
		$flagel = '+';
	}
	$el = abs($el);
	my $elcode = elal($el);
	my $dele = delal($elcode);

	if ($lat<-90 || $lat>90 || $lon<-180 || $lon>180) {
		return 0;
	}

        $lat *= 100000;
        $lon *= 100000;
	my $x = Math::BigInt->new($lat); 
	my $y = Math::BigInt->new($lon);
        my $xx = Math::BigInt->new($lat);
        my $yy = Math::BigInt->new($lon);
	$x->badd($y); 
	my $xy = $x;
	$xx->bsub($yy); 
	my $yx = $xx;
        my $aa = Math::BigInt->new($xy);
        my $bb = Math::BigInt->new($yx);
	my $coef =  Math::BigInt->new('27000000'); 
	$aa->badd($coef);
	$bb->badd($coef);
	$xy = $aa;
	$yx = $bb;
	my $binlat = sprintf ("%b", $xy);
	my $binlon = sprintf ("%b", $yx);
	my @a = split(//,$binlat);
	my @b = split(//,$binlon);
	my $combinedll ='';
	while (@a || @b) {
		my $b1 = pop @a;
		my $b2 = pop @b;
                $b1 = '0' unless defined $b1;
                $b2 = '0' unless defined $b2;
		$combinedll = $b1.$b2.$combinedll;
	}
	my $bigbin = Math::BigInt->from_bin($combinedll);
        my $decimal = $bigbin->bstr();
	my $decismall = Math::BigInt->new($decimal);	

        my $deciminus = Math::BigInt->new(PADD); 
	$decismall->bsub($deciminus);   
	$decimal = $decismall;

	my $geocode; #will return either an alphanumeric geocode, or a triple name geocode here.
	if (defined $geoname) {
		if ($geoname == 2) {
			$geocode = &hybrid($decimal);
		} else {
			if ($geoname == 3) {
				$geocode = &nencdn($decimal);
			} else {
				$geocode = &nencd($decimal,$elcode,$flagel);
			}
		}
	} else {
		$geocode = &encd($decimal);
	}
	return $geocode;
}



=head1 NAME

Geo::Code::XYZEN - Encode latitude,longitude,elevation into three random names and vice versa.

=head1 VERSION

Version 1.0

=cut

our $VERSION = '1.0';


=head1 SYNOPSIS

	use Geo::Code::XYZEN;
	my $g = Geo::Code::XYZEN->new();
	my ($x,$y,$z) = (56.936650,24.088020,6);
	my $geocode = $g->geocode(lat=>$x,lon=>$y,el=>$z);
	print $geocode . "\n";

		#SPATIO-AYLETT-TAKERUG
	
	my $xyz = $g->geocode(gc=>$geocode);
	my ($lat,$lon,$el) = @$xyz;
	print "The latitude,longitude,elevation of $geocode is $lat,$lon,$el\n";
		            
                     #The latitude,longitude,elevation of SPATIO-AYLETT-TAKERUG is 51.51420,-0.08477,6

=head1 DESCRIPTION


Geo::Code::XYZEN is an alternative implementation of Geo::Code::XYZEN


Online Demo. L<where3names.com|https://where3names.com>.


